    public static int[] getValuesInverse(int[] arr) {
        int[] inverse = new int[arr.length];
        for (int i = 0; i < arr.length; i++) {
            inverse[i] = arr[arr.length - 1 - i];
        }
        return inverse;
    }

    public static void main(String[] args) {

        List<ISort> sortList = new ArrayList<>();
        sortList.add(new MergeSort());
        sortList.add(new InsertionSort());
        sortList.add(new SelectionSort());
        sortList.add(new QuickSort());

        List<SystematicStatistics> statistics = new ArrayList<>();
        for (int i = 0; i <= 7; i++) {
            for (ISort sort : sortList) {
            int[] arr = getValues(i);
                System.out.println("-------------------------------------------------- " + sort.GetNameMethod() + " --------------------------------------------------");
                System.out.println();

                System.out.println("------------------------- Aleatrio ------------------------- ");
                System.out.println();

                System.out.println(Arrays.toString(arr));
                long time = sort.Sort(arr);
                sort.CountOperation(getValues(i));
                System.out.println(Arrays.toString(arr));
                System.out.println("Compare: " + time + "ms");
                System.out.println("Operations: " + sort.GetQtdOperationMethod());
                System.out.println();
                statistics.add(new SystematicStatistics(sort.GetNameMethod(), sort.GetQtdOperationMethod(), time, "Aleatrio"));

                System.out.println("------------------------- Ordenado ------------------------- ");
                System.out.println();

                System.out.println(Arrays.toString(arr));
                time = sort.Sort(arr);
                sort.CountOperation(arr);
                System.out.println(Arrays.toString(arr));
                System.out.println("Compare: " + time + "ms");
                System.out.println("Operations: " + sort.GetQtdOperationMethod());
                System.out.println();
                statistics.add(new SystematicStatistics(sort.GetNameMethod(), sort.GetQtdOperationMethod(), time, "Ordenado"));

                System.out.println("------------------------- Inverso ------------------------- ");
                System.out.println();

                arr = getValuesInverse(arr);
                System.out.println(Arrays.toString(arr));
                time = sort.Sort(arr);
                sort.CountOperation(getValuesInverse(arr));
                System.out.println(Arrays.toString(arr));
                System.out.println("Compare: " + time + "ms");
                System.out.println("Operations: " + sort.GetQtdOperationMethod());
                statistics.add(new SystematicStatistics(sort.GetNameMethod(), sort.GetQtdOperationMethod(), time, "Inverso"));

                System.out.println();
                System.out.println();

            }
        }

        ExportExcel.Export(statistics);
    }
